import React from 'react';

function Contact() {
	return (
		<div className="container contact-cont">
			<div className="row">
				<div className="xl-col-3 lg-col-3 md-col-2 sm-col-12 col-12">
					<p>CONTACT WITH ME</p>
				</div>
				<div className="xl-col-9 lg-col-9 md-col-10 sm-col-6 col-6">
					<form>
						<label>Name</label>
						<input />
					</form>
				</div>
			</div>
		</div>
	);
}
export default Contact;
